import React from 'react';
import '../App.css';
import { Button } from './Button';
import './ModelS.css';

function ModelS() {
  return (
    <div className='model-s'>
      <img src='/images/tesla-model-s.jpg'/>
      <h1>Model S</h1>
      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
          GET STARTED
        </Button>
    </div>


    </div>
  );
}

export default ModelS;
